import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <section class="bg-gray-900 text-white h-screen flex flex-col justify-center items-center">
      <h1 class="text-5xl font-bold mb-4">TailwindCSSで魅力的なランディングページを作ろう</h1>
      <p class="text-lg mb-8">簡単に美しいデザインができるCSSフレームワークを使って、ユーザーを引き付けるページを構築しましょう。</p>
      <a href="#services" class="bg-blue-500 text-white px-6 py-3 rounded hover:bg-blue-600 transition duration-200">サービスを見る</a>
    </section>
  );
}

export default App;
